import BaseService from "./baseService.js";

class ProductSchedules extends BaseService {
  getProductSchedules(opts) {
    this.endPoint = "/get-product-schedules";
    return this.get(opts);
  }
  storeProductSchedule(payload) {
    this.endPoint = "/product-schedules";
    return this.post(payload);
  }
}

export default new ProductSchedules();
